Superman v2 #29
&quot;Superman in Exile&quot; part 3, continued from ADVENTURES OF SUPERMAN #451. When Superman comes across yet another dead world he realizes that Hfuhruhurr the Word-Bringer has committed another horrendous act. Continued in Adventures of Superman #452.

Superman v2 #30
&quot;Superman in Exile&quot; part 5, continued from ADVENTURES OF SUPERMAN #452. One step closer to finding redemption, Superman continues his self-imposed exile in deep space. Plus, in the Man of Steel's absence, Lex Luthor plans his biggest coup yet. Continued in Adventures of Superman #453.

Thanks goes to DreamGirl for this release.

